member.example:
This sample shows how to call DefaultAsync.

Query client = new BytesClient().GetQueryClient();

Response response = await client.DefaultAsync(BinaryData.FromObjectAsJson(new object()));

Console.WriteLine(response.Status);

This sample shows how to call DefaultAsync with all parameters.

Query client = new BytesClient().GetQueryClient();

Response response = await client.DefaultAsync(BinaryData.FromObjectAsJson(new object()));

Console.WriteLine(response.Status);

